@oborchers, tensorrt compiles the model graph, and there is no corresponding onnx operator to save the compiled model. Please use the official onnxruntime package or a package built without tensorrt when optimizing the model. 
After the model is optimized, you are free to use the package with tensorrt. 

Add @tianleiwu and @wangyems to refine the optimizer tool to prevent similar failure in the future.
